var position = $(window).scrollTop(); 

// should start at 0

$(window).scroll(function() {
    var scroll = $(window).scrollTop();

    if (scroll > 50) {

   
      if(scroll > position) {

        if($('.sticky-header').hasClass("sticky-header--up")) {
          $('.sticky-header').removeClass("sticky-header--up");
          $('.sticky-header').addClass("sticky-header--down");
        }
        else {
          $('.sticky-header').addClass("sticky-header--down");
        }
      }
      else {
        if($('.sticky-header').hasClass("sticky-header--down")) {
          $('.sticky-header').removeClass("sticky-header--down");
          $('.sticky-header').addClass("sticky-header--up");
        }
        else {
          $('.sticky-header').addClass("sticky-header--up");
        }
      }

      position = scroll;

    }

    else {
      if($('.sticky-header').hasClass("sticky-header--up")) {
          $('.sticky-header').removeClass("sticky-header--up");
        }
    }
}); 

// http://callmenick.com/post/simple-responsive-tabs-javascript-css

$(function () {

  var $tab = $('.js-tabs-btn');
  var $content = $('.js-tabs-content > div');
  var $index = 0;

  $tab.first().addClass('is-active');
  $content.first().addClass('is-active');

  $tab.on('click', toggleTab);

  function toggleTab() {
    $content.removeClass('is-active');
    $tab.removeClass('is-active');
    $index = $tab.index(this);
    console.log($index);
    $content.eq($index).addClass('is-active');
    $tab.eq($index).addClass('is-active');
  }

});



